        const MSG_BYTES: usize = 94;
        let mut msg = [0u8; MSG_BYTES];
        super::random_bytes(&mut msg, MSG_BYTES);
        let mut sig = [0u8; crate::params::lvl3::SIGNBYTES];
        super::signature(&mut sig, &msg, &sk, false);
        assert!(super::verify(&sig, &msg, &pk));
